import React,{useState,useEffect} from 'react'
import Fetch from './Fetch'

function Data() {


const [data,setdata]=useState([])


useEffect(()=>{
    fetchdata()
},[])


async function fetchdata()
{
    Fetch.getdata().then(res=>{
        setdata(res)
    })
}

  return (
    <div>
    {data?data.map((val)=>(
        val.name
    )):<></>}
    </div>
  )
}

export default Data
